const stdout = $input.item.json.stdout;

// Eğer stdout boşsa, boş array döndür
if (!stdout || stdout.trim() === '') {
  return [];
}

// \n ile böl ve boş satırları filtrele
const filenames = stdout.trim().split('\n').filter(line => line.length > 0);

// PROJECT_ID'yi workflow başlangıcından al
const projectId = $('Set Project ID').first().json.PROJECT_ID;

// Her dosya adını işle ve ayrı item olarak döndür
return filenames.map(filename => {
  // Tırnak işaretlerini temizle
  const cleanFilename = filename.trim().replace(/^"|"$/g, '');

  // _S'den önceki kısmı al
  const beforeS = cleanFilename.split('_S')[0];

  // -D veya -R var mı kontrol et
  let sampleId;
  let analysisType;

  if (beforeS.endsWith('-D') || beforeS.endsWith('-R')) {
    // -D veya -R varsa, onu çıkar
    sampleId = beforeS.slice(0, -2);
    analysisType = 'TSO500_HT';
  } else {
    // -D veya -R yoksa, tüm kısmı kullan
    sampleId = beforeS;
    analysisType = 'TSO500_ctDNA';
  }

  return {
    json: {
      filename: cleanFilename,
      sample_id: sampleId,
      analysis_type: analysisType,
      PROJECT_ID: projectId
    }
  };
});

// Tüm önceki item'ları al
const items = $input.all();

// sample_id'ye göre grupla
const sampleGroups = {};

for (const item of items) {
  const sampleId = item.json.sample_id;

  if (!sampleGroups[sampleId]) {
    sampleGroups[sampleId] = {
      sample_id: sampleId,
      files: [],
      PROJECT_ID: item.json.PROJECT_ID
    };
  }

  sampleGroups[sampleId].files.push(item.json.filename);
}

// Her sample için ayrı item oluştur
return Object.values(sampleGroups).map(group => ({
  json: {
    sample_id: group.sample_id,
    file_count: group.files.length,
    files: group.files,
    PROJECT_ID: group.PROJECT_ID
  }
}));

