const stdout = $input.item.json.stdout;
const inputFolderId = $('Get Input Folder ID').item.json.stdout.trim();
const projectId = $('Set Project ID').first().json.PROJECT_ID;

try {
  const fileList = JSON.parse(stdout);

  if (!fileList.items || fileList.items.length === 0) {
    return [];
  }

  return fileList.items.map(file => ({
    json: {
      file_id: file.id,
      file_name: file.details.name,
      input_folder_id: inputFolderId,
      PROJECT_ID: projectId
    }
  }));
} catch (error) {
  console.error('Error parsing file list:', error);
  return [];
}

